import './ExpensesList.css';
import ExpenseItem from '../ExpenseItem';

function ExpensesList(props) {
  return (
    <ul>
      props.items.length === 0 ? (<p>No expenses found.</p>
      ) : ( props.items.map((expense) => (
      <ExpenseItem
        key={expense.id}
        title={expense.title}
        amount={expense.amount}
        date={expense.date}
      />
      )) );
    </ul>
  );
}
export default ExpensesList;
